import React from 'react'
import './styles/Card.css'

function Add(props) {
    return (
        <div className="container">
            <div className="Fitness-Add">
                <h1>Hello {props.userName}!</h1>
                <p>Let's workout to get some gains!</p>
            </div>
        </div>
    )
}

export default Add
